import React from 'react';

function Images({flex , hover, height = "18rem",  src}) {
    console.log(src);
    return (
        <div className="image-portfolio" style={{
            height:height,
            flex:flex,
            overflow:"hidden"
        }}>
            <img  style={{
                width:"100%",
                height:"10%"
            }} src={src}>
            </img>
        </div>
    );
}

export default Images;
